import React from 'react'
import styles from './button.module.scss'


const Button = ({children, href}) => (
  <>
  {href ? 
    (<a
      href={props}       
      target="_blank" 
      rel="noopener noreferrer" 
      className={styles.button}>
        {children}
      </a>) 
    : 
    (<button className={styles.button}>
        {children}
      </button>)

  }
  </>
)

export default Button
